// src/AdminDashboard.js
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import './AdminDashboard.css';

function AdminDashboard() {
  const [calisanlar, setCalisanlar] = useState([]);
  const [otoparklar, setOtoparklar] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  // API'den çalışanları ve otopark alanlarını çekelim
  useEffect(() => {
    const fetchData = async () => {
      try {
        const [calisanRes, otoparkRes] = await Promise.all([
          fetch('/api/calisanlar'),
          fetch('/api/otoparklar')
        ]);
        const calisanData = await calisanRes.json();
        const otoparkData = await otoparkRes.json();
        setCalisanlar(calisanData);
        setOtoparklar(otoparkData);
        setLoading(false);
      } catch (err) {
        setError('Veriler çekilirken bir hata oluştu.');
        setLoading(false);
      }
    };
    fetchData();
  }, []);

  if (loading) return <div>Yükleniyor...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div className="admin-dashboard">
      <header>
        <h1>Admin Paneli</h1>
        <nav className="admin-nav">
          <ul>
            <li><Link to="/admin/calisanlar">Çalışan Yönetimi</Link></li>
            <li><Link to="/admin/otoparklar">Otopark Yönetimi</Link></li>
            <li><Link to="/admin/raporlar">Raporlar</Link></li>
          </ul>
        </nav>
      </header>

      <main>
        <section>
          <h2>Çalışanlar</h2>
          <table>
            <thead>
              <tr>
                <th>ID</th>
                <th>Ad</th>
                <th>Soyad</th>
                <th>Email</th>
              </tr>
            </thead>
            <tbody>
              {calisanlar.map((calisan) => (
                <tr key={calisan.calisan_ID}>
                  <td>{calisan.calisan_ID}</td>
                  <td>{calisan.calisan_ad}</td>
                  <td>{calisan.calisan_soyad}</td>
                  <td>{calisan.calisan_mail}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </section>

        <section>
          <h2>Otopark Alanları</h2>
          <table>
            <thead>
              <tr>
                <th>ID</th>
                <th>Ad</th>
                <th>Durum</th>
              </tr>
            </thead>
            <tbody>
              {otoparklar.map((otopark) => (
                <tr key={otopark.yer_ID}>
                  <td>{otopark.yer_ID}</td>
                  <td>{otopark.yer_ad}</td>
                  <td>{otopark.yer_durum}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </section>
      </main>
    </div>
  );
}

export default AdminDashboard;
